g2:c.PROCEDURE.g2:a.TEXT:
guide-add-list-elements-sa (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
MO, EB: item-or-value;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "running guide-add-list-elements-sa";

    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", D);

    if (EB exists and EB is an item) then
        begin
        if (DEBUG) then
            inform the operator that "EB exists, mc: [the message-contents of EB]";

        if (EB is the-current-uil-message-being-edited-on W) then
            begin
            if (DEBUG) then
                inform the operator that "EB is the-current-uil-message-being-edited-on";
            call upp-end-edit-session-in-window-if-any (W);
            wait until the message-contents of EB receives a value;
            end;

        if (DEBUG) then
            inform the operator that "update SA";
        SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);
        if (SA exists and SA is an item) then
            begin
            call uil-create-message (SA, "[the message-contents of EB]", 1);
            if (the number-of-messages of SA > 2) then
                call uil-display-message-list (SA, the number-of-messages of SA - 2)
            else
                call uil-display-message-list (SA, the current-message-pointer of SA);
            end;
        end;
end

guide-user-selected-element (message: item-or-value, scroll-area: item-or-value, window: class ui-client-item)
EB: item-or-value;
begin
    call uil-message-selection (message, scroll-area, window);

    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", the workspace of scroll-area);
    call uil-update-text (EB, "[the message-contents of message]");
end

guide-modify-list-elements-sa (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
MO, EB: item-or-value;
begin
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", D);

    if (EB exists and EB is an item and (the message-contents of EB /= "")) then
        begin
        if (EB is the-current-uil-message-being-edited-on W) then
            begin
            call upp-end-edit-session-in-window-if-any (W);
            wait until the message-contents of EB receives a value;
            end;
        SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);
        if (SA exists and SA is an item and there exists a item that is a-selected-message-of SA) then
            begin
            MO = the item that is a-selected-message-of SA;
            call uil-update-text (MO, the message-contents of EB);
            end;
        end;
end

guide-select-list-or-array-message (MO: class uil-message-object, SA: class uil-scroll-area, W: class ui-client-item )
EB: class uil-edit-box;
SA2: class uil-scroll-area;
OBJ: item-or-value;
ATT: symbol;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running guide-select-list-or-array-message";

    call uil-message-selection (MO, SA, W);

    {-- Fill in bottom scroll-area with elements --}
    OBJ = call uil-find-initiating-object (the uil-dialog superior to the workspace of SA);

    ATT = symbol ("[the message-contents of MO]");

    if (DEBUG) then
        inform the operator that "ATT: [ATT]";

    SA2 = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", the uil-dialog superior to the workspace of SA);
    call uil-clear-messages (SA2);
    conclude that the uil-update-value of SA2 is true;
    conclude that the uil-event-source-object of SA2 = the symbol initiating-object;
    conclude that the uil-event-source-attribute of SA2 = ATT;

    if (DEBUG) then
        inform the operator that "update [the id of SA2]";

    call uil-call-update-method-for-grobj (SA2, W);

    {-- Set format for edit-box --}
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", the uil-dialog superior to the workspace of SA);
    call uil-update-text (EB, "");

{-- SYMBOL --}
    if (the item-or-value that is an attribute of OBJ named by ATT is a symbol-array) or (the item-or-value that is an attribute of OBJ named by ATT is a symbol-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-symbol-format

{-- TEXT --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is a text-array) or (the item-or-value that is an attribute of OBJ named by ATT is a text-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-text-format

{-- INTEGER --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is an integer-array) or (the item-or-value that is an attribute of OBJ named by ATT is an integer-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-integer-format

{-- FLOAT --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is a float-array) or (the item-or-value that is an attribute of OBJ named by ATT is a float-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-quantity-format

{-- QUANTITY --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is a quantity-array) or (the item-or-value that is an attribute of OBJ named by ATT is a quantity-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-quantity-format

{-- TRUTH-VALUE --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is an truth-value-array) or (the item-or-value that is an attribute of OBJ named by ATT is an truth-value-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-truth-value-format

{-- ITEM --}
    else if (the item-or-value that is an attribute of OBJ named by ATT is an item-array) or (the item-or-value that is an attribute of OBJ named by ATT is an item-list) then
        conclude that the uil-format-specification of EB = the symbol guidata-item-format

{-- G2-LIST or G2-ARRAY --}
    else
         conclude that the uil-format-specification of EB = the symbol unspecified;

    if (DEBUG) then
        inform the operator that "format: [the uil-format-specification of EB]";
end

guide-clear-list-elements-sa (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
begin
    SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);
    call uil-delete-selected-messages (SA);
end

guide-setup-array-elements-dialog (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
T: class uil-text;
EB: class uil-edit-box;
S: symbol;
OBJ: item-or-value;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running guide-setup-array-element-dialog";

    {-- Clear elements edit-box --}
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", D);
    call uil-update-text (EB, "");

    {-- Set header for top scroll-area --}
    T = call uil-get-grobj-from-id-on-dlg-or-wksp ("type-text", D);
    call uil-update-text (T, "Arrays:");

    {-- Set Title --}
    call uil-update-text (the uil-dialog-title upon the subworkspace of D, "Edit Array");
    call uil-justify-dialog-title (the uil-dialog-title upon the subworkspace of D, the subworkspace of D);

    {-- Clear top scroll-area which lists arrays to edit --}
    SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("attributes-sa", D);
    call uil-clear-messages (SA);

    {-- Fill in top scroll-area with arrays contained in object --}
    OBJ = call uil-find-initiating-object (D);
    if not (OBJ is a g2-array) then
        begin
        for S = each symbol that is a user-defined attribute name of O do
            if (the item-or-value that is an attribute of O named by S exists and the item-or-value that is an attribute of O named by S is a g2-array) then
                call uil-create-message (SA, "[S]", 1);
            end;

        call uil-display-message-list (SA, 0);
        end;

    {-- Clear bottom scroll-area which lists array elements --}
    SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);
    call uil-clear-messages (SA);    

    {-- Fill bottom scroll-area in with array elements --}
    if (OBJ is a g2-array) then
        begin
        conclude that the uil-event-source-object of SA = the symbol initiating-object;
        conclude that the uil-event-source-attribute of SA = the symbol unspecified;

        call uil-call-update-method-for-grobj (SA, W);
       if (OBJ is a symbol-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-symbol-format 
        else if (OBJ is a text-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-text-format 
        else if (OBJ is a truth-value-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-truth-value-format 
        else if (OBJ is an integer-array) then 
            conclude that the uil-format-specification of EB = the symbol guidata-integer-format
        else if (OBJ is a float-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-quantity-format 
        else if (OBJ is a quantity-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-quantity-format 
        else if (OBJ is an item-array) then
            conclude that the uil-format-specification of EB = the symbol guidata-item-format
        else
            conclude that the uil-format-specification of EB = the symbol unspecified; 
        end
    else
        begin
        conclude that the uil-event-source-object of SA = the symbol unspecified;
        conclude that the uil-event-source-attribute of SA = the symbol unspecified;
        end;

if (DEBUG) then
    inform the operator that "Leaving setup-array-element-dialog";
end

guide-setup-list-elements-dialog (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
SA: class uil-scroll-area;
T: class uil-text;
EB: class uil-edit-box;
S: symbol;
OBJ: item-or-value;
begin
    {-- Clear elements edit-box --}
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("element-eb", D);
    call uil-update-text (EB, "");

    {-- Set header for top scroll-area --}
    T = call uil-get-grobj-from-id-on-dlg-or-wksp ("type-text", D);
    call uil-update-text (T, "Lists:");

    {-- Set Title --}
    call uil-update-text (the uil-dialog-title upon the subworkspace of D, "Edit List");
    call uil-justify-dialog-title (the uil-dialog-title upon the subworkspace of D, the subworkspace of D);

    {-- Clear top scroll-area which lists lists to edit --}
    SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("attributes-sa", D);
    call uil-clear-messages (SA);

    {-- Fill in top scroll-area with lists contained in object --}
    OBJ = call uil-find-initiating-object (D);
    if not (OBJ is a g2-list) then
        begin   
        for S = each symbol that is a user-defined attribute name of O do
            if (the item-or-value that is an attribute of O named by S exists and the item-or-value that is an attribute of O named by S is a g2-list) then
                call uil-create-message (SA, "[S]", 1);
            end;
    
        call uil-display-message-list (SA, 0);
        end;

    {-- Clear bottom scroll-area which lists list elements --}
    SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);
    call uil-clear-messages (SA); 

    {-- Fill bottom scroll-area in with list elements --}
    if (OBJ is a g2-list) then
        begin
        conclude that the uil-event-source-object of SA = the symbol initiating-object;
        conclude that the uil-event-source-attribute of SA = the symbol unspecified;

        call uil-call-update-method-for-grobj (SA, W);
        if (OBJ is a symbol-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-symbol-format 
        else if (OBJ is a text-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-text-format 
        else if (OBJ is a truth-value-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-truth-value-format 
        else if (OBJ is an integer-list) then 
            conclude that the uil-format-specification of EB = the symbol guidata-integer-format
        else if (OBJ is a float-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-quantity-format 
        else if (OBJ is a quantity-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-quantity-format 
        else if (OBJ is an item-list) then
            conclude that the uil-format-specification of EB = the symbol guidata-item-format
        else
            conclude that the uil-format-specification of EB = the symbol unspecified; 
        end
    else
        begin
        conclude that the uil-event-source-object of SA = the symbol unspecified;
        conclude that the uil-event-source-attribute of SA = the symbol unspecified;
        end;
end

guide-conclude-list-elements-dialog (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
OBJ: item-or-value;
SA, SA2: class uil-scroll-area;
MO: class uil-message-object;
S: symbol;
begin
    OBJ = call uil-find-initiating-object (D);

    SA2 = call uil-get-grobj-from-id-on-dlg-or-wksp ("list-elements-sa", D);

    if not (OBJ is a g2-array or OBJ is a g2-list) then
        begin
        SA = call uil-get-grobj-from-id-on-dlg-or-wksp ("attributes-sa", D);
        
        if (there exists a uil-message-object that is a-selected-message-of SA) then
            begin           
            for MO = each uil-message-object that is a-selected-message-of SA do
                S = symbol ("[the message-contents of MO]");
                conclude that the uil-event-target-object of SA2 = the symbol initiating-object;
                conclude that the uil-event-target-attribute of SA2 = S;
                end;
            end;
        end
    else
        begin
        conclude that the uil-event-target-object of SA2 = the symbol initiating-object;
        conclude that the uil-event-target-attribute of SA2 = the symbol unspecified;
        end;

    call uil-call-conclude-method-for-grobj (SA2, W);
end
